void ValidateNavigationStatus(const NavigationStatus& nav_status,
    const NavigationStatus& expected_nav_status) {

  if (expected_nav_status.has_route_state() && (nav_status.route_state() != expected_nav_status.route_state()))
    throw std::runtime_error("Incorrect route state for NavigationStatus - found: " + NavigationStatus_RouteState_Name(nav_status.route_state()) + " | expected: " + NavigationStatus_RouteState_Name(expected_nav_status.route_state()));

  if (expected_nav_status.has_lat() && (!valhalla::midgard::equal<float>(nav_status.lat(), expected_nav_status.lat(), 0.00002f)))
    throw std::runtime_error("Incorrect lat for NavigationStatus - found: " + std::to_string(nav_status.lat()) + " | expected: " + std::to_string(expected_nav_status.lat()));

  if (expected_nav_status.has_lon() && (!valhalla::midgard::equal<float>(nav_status.lon(), expected_nav_status.lon(), 0.00002f)))
    throw std::runtime_error("Incorrect lon for NavigationStatus - found: " + std::to_string(nav_status.lon()) + " | expected: " + std::to_string(expected_nav_status.lon()));

  if (expected_nav_status.has_leg_index() && (nav_status.leg_index() != expected_nav_status.leg_index()))
    throw std::runtime_error("Incorrect leg_index for NavigationStatus - found: " + std::to_string(nav_status.leg_index()) + " | expected: " + std::to_string(expected_nav_status.leg_index()));

  if (expected_nav_status.has_remaining_leg_length() && (!valhalla::midgard::equal<float>(nav_status.remaining_leg_length(), expected_nav_status.remaining_leg_length(), 0.005f)))
    throw std::runtime_error("Incorrect remaining_leg_length for NavigationStatus - found: " + std::to_string(nav_status.remaining_leg_length()) + " | expected: " + std::to_string(expected_nav_status.remaining_leg_length()));

  if (expected_nav_status.has_remaining_leg_time() && (!valhalla::midgard::equal<float>(nav_status.remaining_leg_time(), expected_nav_status.remaining_leg_time(), (expected_nav_status.remaining_leg_time() * 0.0066f))))
    throw std::runtime_error("Incorrect remaining_leg_time for NavigationStatus - found: " + std::to_string(nav_status.remaining_leg_time()) + " | expected: " + std::to_string(expected_nav_status.remaining_leg_time()));

  if (expected_nav_status.has_maneuver_index() && (nav_status.maneuver_index() != expected_nav_status.maneuver_index()))
    throw std::runtime_error("Incorrect maneuver_index for NavigationStatus - found: " + std::to_string(nav_status.maneuver_index()) + " | expected: " + std::to_string(expected_nav_status.maneuver_index()));

  if (expected_nav_status.has_remaining_maneuver_length() && (!valhalla::midgard::equal<float>(nav_status.remaining_maneuver_length(), expected_nav_status.remaining_maneuver_length(), 0.005f)))
    throw std::runtime_error("Incorrect remaining_maneuver_length for NavigationStatus - found: " + std::to_string(nav_status.remaining_maneuver_length()) + " | expected: " + std::to_string(expected_nav_status.remaining_maneuver_length()));

  if (expected_nav_status.has_remaining_maneuver_time() && (!valhalla::midgard::equal<float>(nav_status.remaining_maneuver_time(), expected_nav_status.remaining_maneuver_time(), (expected_nav_status.remaining_maneuver_time() * 0.0066f))))
    throw std::runtime_error("Incorrect remaining_maneuver_time for NavigationStatus - found: " + std::to_string(nav_status.remaining_maneuver_time()) + " | expected: " + std::to_string(expected_nav_status.remaining_maneuver_time()));

  if (expected_nav_status.has_instruction_maneuver_index() && (nav_status.instruction_maneuver_index() != expected_nav_status.instruction_maneuver_index()))
    throw std::runtime_error("Incorrect instruction maneuver_index for NavigationStatus - found: " + std::to_string(nav_status.instruction_maneuver_index()) + " | expected: " + std::to_string(expected_nav_status.instruction_maneuver_index()));

  if (expected_nav_status.has_transition_alert_length() && (!valhalla::midgard::equal<float>(nav_status.transition_alert_length(), expected_nav_status.transition_alert_length(), 0.005f)))
    throw std::runtime_error("Incorrect transition_alert_length for NavigationStatus - found: " + std::to_string(nav_status.transition_alert_length()) + " | expected: " + std::to_string(expected_nav_status.transition_alert_length()));
}

void ValidateOnRouteLocationCloseToOrigin(bool found_value,
    bool expected_on_route_location_close_to_origin) {

  if (found_value != expected_on_route_location_close_to_origin)
    throw std::runtime_error("Incorrect OnRouteLocationCloseToOrigin boolean - found: " + std::string(found_value ? "true" : "false") + " | expected: " + std::string(expected_on_route_location_close_to_origin ? "true" : "false"));
}

