void TestGetWordCount(const NavigatorTest& nav) {
  std::string instruction;

  instruction = " . ; Test with,crazy:weird   stuff. ;ok  .";
  TryGetWordCount(nav, instruction, 6);

  /////////////////////////////////////////////////////////////////////////////
  // English

  // Turn right with no street names
  instruction = "Turn right.";
  TryGetWordCount(nav, instruction, 2);

  // Simple turn right
  instruction = "Turn right onto Middletown Road.";
  TryGetWordCount(nav, instruction, 5);

  // Turn right with multiple street names
  instruction = "Turn right onto Maryland 43 West, White Marsh Boulevard.";
  TryGetWordCount(nav, instruction, 9);

  // Turn right with multiple street names and multi-cue
  instruction = "Turn right onto Riverside Parkway, Maryland 5 43. Then Take the Interstate 95 North ramp on the right.";
  TryGetWordCount(nav, instruction, 18);

  // Destination
  instruction = "1 hundred South Charles Street will be on the left.";
  TryGetWordCount(nav, instruction, 10);

  // Bear left
  instruction = "Bear left onto South Lime Street.";
  TryGetWordCount(nav, instruction, 6);

  // Bear right with multi-cue
  instruction = "Bear right onto Lindle Road, Pennsylvania 4 41. Then Turn right onto Eisenhower Boulevard.";
  TryGetWordCount(nav, instruction, 14);

  // Continue
  instruction = "Continue for 500 feet.";
  TryGetWordCount(nav, instruction, 4);

  // Continue with decimal distance
  instruction = "Continue for 30.7 miles.";
  TryGetWordCount(nav, instruction, 5);

  // Continue with multi-cue
  instruction = "Continue on Virginia 7 Business, Harry Byrd Highway for 1 tenth of a mile. Then Take the ramp on the right.";
  TryGetWordCount(nav, instruction, 21);

  // Origin
  instruction = "Drive east on East Fulton Street for 400 feet.";
  TryGetWordCount(nav, instruction, 9);

  // Origin with multi-cue
  instruction = "Drive southeast on Interstate 2 83 South for 1 tenth of a mile. Then Take exit 2 on the right.";
  TryGetWordCount(nav, instruction, 20);

  // Enter roundabout
  instruction = "Enter the roundabout and take the 2nd exit.";
  TryGetWordCount(nav, instruction, 8);

  // Exit roundabout
  instruction = "Exit the roundabout onto Philadelphia Road, Maryland 7.";
  TryGetWordCount(nav, instruction, 8);

  // Keep left with multi-cue
  instruction = "Keep left to take Pennsylvania 7 43 South toward Grantville, Hershey. Then Turn left onto Ridge Road.";
  TryGetWordCount(nav, instruction, 17);

  // Keep right with multi-cue
  instruction = "Keep right to take New Holland Avenue toward Downtown Lancaster. Then Bear right onto New Holland Pike.";
  TryGetWordCount(nav, instruction, 17);

  // Keep straight with multi-cue
  instruction = "Keep straight to take Pennsylvania 4 41 South toward Middletown. Then Turn left onto Lindle Road.";
  TryGetWordCount(nav, instruction, 16);

  // Merge
  instruction = "Merge onto Interstate 90 East, Massachusetts Turnpike.";
  TryGetWordCount(nav, instruction, 7);

  // Take exit
  instruction = "Take exit 2 42 on the right onto Interstate 83 toward York, Baltimore.";
  TryGetWordCount(nav, instruction, 13);

  /////////////////////////////////////////////////////////////////////////////
  // German
  // "Take the A 9 ramp on the right toward Stuttgart, Nürnberg."
  instruction = "Über die Auffahrt leicht nach rechts auf A 9 abbiegen Richtung Stuttgart, Nürnberg.";
  TryGetWordCount(nav, instruction, 13);

  /////////////////////////////////////////////////////////////////////////////
  // Russian
  // "Continue on Триумфальная площадь, Triumfalnaya Square for 90 meters. Then Continue on 1-я Тверская-Ямская улица."
  instruction = "Проедьте 90 метров по Триумфальная площадь, Triumfalnaya Square. Затем Продолжайте по 1-я Тверская-Ямская улица.";
  TryGetWordCount(nav, instruction, 16);

  /////////////////////////////////////////////////////////////////////////////
  // Hindi
  // "Continue on Mahatma Gandhi Road for 1.1 kilometers."
  instruction = "Mahatma Gandhi Road पर 1.1 किलोमीटर के लिए जारी रहें.";
  TryGetWordCount(nav, instruction, 11);

}

void TryGetPreTransitionThreshold(const NavigatorTest& nav, uint32_t leg_index,
    size_t instruction_index, uint32_t expected_time) {

  const auto& instruction = nav.route().trip().legs(leg_index).
      maneuvers(instruction_index).verbal_pre_transition_instruction();
  uint32_t found_time = nav.GetPreTransitionThreshold(instruction_index);

  if (found_time != expected_time)
    throw std::runtime_error("Incorrect PreTransitionThreshold time for the instruction=\"" + instruction + "\" - found: " + std::to_string(found_time) + " | expected: " + std::to_string(expected_time));
}

